import 'antd/dist/antd.css' // \u53EF\u5168\u5C40\u5F15\u5165\uFF0C\u6B64\u5904\u662F\u6F14\u793A
import { message, Button, Space } from 'antd'
import { QueryList, QueryForm, QueryTable, QueryToolbar } from '@pf-ui/dyn-render-core'

const Index = () => {
  const getList = async (params) => {
    // const res = // getEntityList(entity, params)
    console.log(params, '--params--')
    const res = Promise.resolve({
      list: [
        {username: '\u7AE0\u4E09', email: '113@qq.com', gender: 1},
        {username: '\u674E\u56DB', email: '123@qq.com', gender: 1},
        {username: 'dd', email: '113@qq.com', gender: 1},
        {username: 'aa', email: '123@qq.com', gender: 1},
        {username: 'cc', email: '113@qq.com', gender: 1},
        {username: 'ee', email: '123@qq.com', gender: 1},
        {username: 'ff', email: '113@qq.com', gender: 1},
        {username: 'gg', email: '123@qq.com', gender: 1},
        {username: 'hh', email: '113@qq.com', gender: 1},
        {username: 'ii', email: '123@qq.com', gender: 1},
        {username: 'jj', email: '113@qq.com', gender: 1},
        {username: 'kk', email: '123@qq.com', gender: 1},
      ],
      total: 12
    })
    return res;
  }

  const getColumns = ({
    onDel,
    refresh,
  }) => {
    return [
      {
        title: '\u7528\u6237\u540D',
        dataIndex: 'username',
        key: 'username',
      },
      {
        title: '\u90AE\u7BB1',
        dataIndex: 'email',
        key: 'email',
      },
      {
        title: '\u6027\u522B',
        dataIndex: 'gender',
        key: 'gender',
        render: (val, record) => (val === 1 ? '\u7537' : '\u5973'),
      },
      {
        title: '\u64CD\u4F5C',
        dataIndex: 'operation',
        key: 'operation',
        render: (val, record) => {
          return (
            <div>
              <a onClick={(e) => {
                e.stopPropagation()
                message.success('\u7F16\u8F91')
              }}>\u7F16\u8F91 </a>
              <a onClick={(e) => {
                e.stopPropagation()
                onDel(record, refresh)
              }}> \u5220\u9664 </a>
            </div>
          )
        }
      }
    ]
  }

  const onDel=(id, refresh) => {
    console.log(id, 'delete')
    message.success('\u5220\u9664')
  }

  const Schema = {
    type: 'object',
    properties: {
      username: {
        type: 'string',
        title: '\u7528\u6237\u540D',
        // required: true,
        'x-decorator': 'FormItem',
        'x-component': 'Input',
      },
      email: {
        type: 'string',
        title: '\u90AE\u7BB1',
        'x-validator': 'email',
        // required: true,
        'x-decorator': 'FormItem',
        'x-component': 'Input',
      }
    }
  }

  return (
    <div>
      <QueryList service={getList}>
        <QueryForm schema={Schema} gridConfig={{maxColumns: 4, minWidth: 150}} />
        <QueryToolbar>
          {({refresh, selectedRowKeys}) => (
            <Space>
              <Button onClick={() => console.log(selectedRowKeys)}>\u4E0B\u8F7D</Button>
              <Button>\u5BFC\u51FA</Button>
            </Space>
          )} 
        </QueryToolbar>
        <QueryTable
          columns={({refresh}) => getColumns({ onDel, refresh })}
          mode='checkbox'
          rowKey={(record) => record.username}
          primaryKey='username'
        />
      </QueryList>
    </div>
  )
}

